import { Button } from "@mui/base";
import { Box, Grid, TextField } from "@mui/material";
import React from "react";

const login = () => {
  return (
    <div>
      <Grid container spacing={3}>
        <Grid item xs={12} style={{ color: "black" }}>
          <div>Welcome</div>
          <div>God to see you</div>
        </Grid>
        <Grid item xs={12} sx={{ flexGrow: 1, px: 3 }}>
          <TextField
            id="outlined-basic"
            variant="outlined"
            size="small"
            sx={{ my: 1 }}
          />
          <TextField
            id="outlined-basic"
            variant="outlined"
            size="small"
            sx={{ my: 1, mx: "auto", p: 2 }}
          />
          <Box sx={{ my: 1, mx: "auto", p: 2 }}>
            <Button>Login</Button>
          </Box>
        </Grid>
      </Grid>
    </div>
  );
};

export default login;
